import React from "react"

function Note(props) {

function clickHandeler(e){

    () => { return props.removeNote(props.id)};
    e.preventDefault()

}
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={clickHandeler}>DELETE</button>
    </div>
  );
}

export default Note;
